INSERT INTO `research_report` VALUES ('248', '2021年度一季稻分孽期苗情', 'crop_01', 'http://139.224.41.123', '<h1 data-v-b00fa61e=\"\" style=\"width: 80%; margin: 0px auto; text-align: center;\"><input data-v-b00fa61e=\"\" type=\"text\" value=\"2021年度一季稻分孽期苗情\" class=\"title\" style=\"width: 70%; background: none; font-size: 25px; text-align: center; border: none;\" disabled=\"true\"></h1><div data-v-b00fa61e=\"\"><h2 data-v-b00fa61e=\"\">一、当前苗情</h2><h3 data-v-b00fa61e=\"\">1．栽插穴数、基本苗介绍:</h3><p data-v-b00fa61e=\"\">\n          &nbsp;&nbsp;<span data-v-b00fa61e=\"\" style=\"font-weight: bold;\">中籼稻：</span>\n          育苗移栽（人工移栽+机插秧+盘育抛栽）的平均亩栽 <u data-v-b00fa61e=\"\">1.85</u> 万穴，比去年 <u data-v-b00fa61e=\"\">增加1.85</u> 万穴，\n          基本苗 <u data-v-b00fa61e=\"\">4.98</u>  万，比去年<u data-v-b00fa61e=\"\">增加4.98</u>  万。\n          其中，人工移栽的平均亩栽  <u data-v-b00fa61e=\"\">1.85</u>  万穴，亩基本苗 <u data-v-b00fa61e=\"\">4.98</u> 万；\n          机插的平均亩栽 <u data-v-b00fa61e=\"\">0.00</u> 万穴，亩基本苗 <u data-v-b00fa61e=\"\">0.00</u>  万；\n          盘育抛栽的平均亩栽 <u data-v-b00fa61e=\"\">0.00</u> 万穴，亩基本苗 <u data-v-b00fa61e=\"\">0.00</u>万。\n          直播的平均亩基本苗 <u data-v-b00fa61e=\"\">0.00</u> 万，比去年<u data-v-b00fa61e=\"\">减少0.00</u>万亩    。\n        </p><p data-v-b00fa61e=\"\">\n          &nbsp;&nbsp;<span data-v-b00fa61e=\"\" style=\"font-weight: bold;\">中粳稻：</span>\n          育苗移栽的平均亩栽 <u data-v-b00fa61e=\"\">0.00</u> 万穴，比去年 <u data-v-b00fa61e=\"\">减少0.00</u> 万穴，\n          基本苗 <u data-v-b00fa61e=\"\">0.00</u>  万，比去年<u data-v-b00fa61e=\"\">减少0.00</u>  万。\n          其中，人工移栽的平均亩栽  <u data-v-b00fa61e=\"\">0.00</u>  万穴，亩基本苗 <u data-v-b00fa61e=\"\">0.00</u> 万；\n          机插的平均亩栽 <u data-v-b00fa61e=\"\">0.00</u> 万穴，亩基本苗 <u data-v-b00fa61e=\"\">0.00</u>  万；\n          直播的平均亩基本苗 <u data-v-b00fa61e=\"\">0.00</u> 万，比去年<u data-v-b00fa61e=\"\">减少0.00</u>万亩    。\n        </p><h3 data-v-b00fa61e=\"\">2．叶龄、群体茎蘖数介绍</h3><p data-v-b00fa61e=\"\">\n          &nbsp;&nbsp;<span data-v-b00fa61e=\"\" style=\"font-weight: bold;\">中籼稻：</span>移栽（人工移栽+机插秧+盘育抛栽）的主茎叶龄<u data-v-b00fa61e=\"\">12.01</u>叶，比去年<u data-v-b00fa61e=\"\">增加12.01</u> 叶；\n          平均亩茎蘖数 <u data-v-b00fa61e=\"\">28.72</u> 万，比去年<u data-v-b00fa61e=\"\">增加28.72</u>  万。\n          其中，人工栽插的主茎叶龄<u data-v-b00fa61e=\"\">12.01</u>叶，平均亩茎蘖数<u data-v-b00fa61e=\"\">28.72</u> 万；\n          机械栽插主茎叶龄<u data-v-b00fa61e=\"\">0.00</u>叶，平均亩茎蘖数<u data-v-b00fa61e=\"\">0.00</u> 万；\n          抛栽的主茎叶龄<u data-v-b00fa61e=\"\">0.00</u>叶，平均亩茎蘖数<u data-v-b00fa61e=\"\">0.00</u> 万。\n          直播的主茎叶龄<u data-v-b00fa61e=\"\">0.00</u>叶，比去年<u data-v-b00fa61e=\"\">减少0.00</u> 叶；\n          平均亩茎蘖数 <u data-v-b00fa61e=\"\">0.00</u>万，比去年<u data-v-b00fa61e=\"\">减少0.00</u>万。\n        </p><p data-v-b00fa61e=\"\">\n          &nbsp;&nbsp;<span data-v-b00fa61e=\"\" style=\"font-weight: bold;\">中粳稻：</span>移栽（人工移栽+机插秧+盘育抛栽）的主茎叶龄<u data-v-b00fa61e=\"\">0.00</u>叶，比去年<u data-v-b00fa61e=\"\">减少0.00</u> 叶；\n          平均亩茎蘖数 <u data-v-b00fa61e=\"\">0.00</u> 万，比去年<u data-v-b00fa61e=\"\">减少0.00</u>  万。\n          其中，人工栽插的主茎叶龄<u data-v-b00fa61e=\"\">0.00</u>叶，平均亩茎蘖数<u data-v-b00fa61e=\"\">0.00</u> 万；\n          机械栽插主茎叶龄<u data-v-b00fa61e=\"\">0.00</u>叶，平均亩茎蘖数<u data-v-b00fa61e=\"\">0.00</u> 万；\n          直播的主茎叶龄<u data-v-b00fa61e=\"\">0.00</u>叶，比去年<u data-v-b00fa61e=\"\">减少0.00</u> 叶；\n          平均亩茎蘖数 <u data-v-b00fa61e=\"\">0.00</u>万，比去年<u data-v-b00fa61e=\"\">减少0.00</u>万。\n        </p><h3 data-v-b00fa61e=\"\">3．面上苗情</h3><p data-v-b00fa61e=\"\">\n          全县（市、区）一季稻面积<input data-v-b00fa61e=\"\" type=\"text\" style=\"width: 50px; background: none; border-top: none; border-right: none; border-bottom: 1px solid rgb(0, 0, 0); border-left: none; border-image: initial; font-size: 18px; outline: none;\" disabled=\"true\" value=\"21\">万亩，\n          较去年<input data-v-b00fa61e=\"\" type=\"text\" style=\"width: 60px; border-top: none; border-right: none; border-bottom: 1px solid rgb(0, 0, 0); border-left: none; border-image: initial; font-size: 18px; outline: none;\" disabled=\"true\" value=\"19.8\">  万亩，\n          \n          一类苗占 <u data-v-b00fa61e=\"\">0.00</u>%，二类苗占<u data-v-b00fa61e=\"\">0.00</u>%，三类苗占<u data-v-b00fa61e=\"\">0.00</u>%。\n          一、二类苗占<u data-v-b00fa61e=\"\">0.00</u> %，比去年<u data-v-b00fa61e=\"\">增加0.00</u>   个百分点，\n          <span data-v-b00fa61e=\"\">苗情长势:</span><input data-v-b00fa61e=\"\" type=\"text\" style=\"width: 71%; height: 30px; background: none; border-top: none; border-right: none; border-bottom: 1px solid rgb(0, 0, 0); border-left: none; border-image: initial; font-size: 18px; outline: none;\" value=\"好于上年。\" disabled=\"true\"></p></div><div data-v-b00fa61e=\"\"><h2 data-v-b00fa61e=\"\">二、主要问题</h2><div data-v-b00fa61e=\"\"><textarea data-v-b00fa61e=\"\" cols=\"30\" rows=\"10\" placeholder=\"请输入当前生产中遇到的问题\" class=\"textarea\" disabled=\"true\" style=\"\n        width: 98%;\n        border: none;\n        outline: none;\n        border-bottom: 1px solid #000;\n        background:none;\n        height: 30px;\n        line-height: 30px;\n        font-size: 20px;\n        padding-left: 30px;\n        margin: 0 0 10px 0 ;\n        \">气温偏高加速了叶龄增长，降水偏少和光照偏多利于控制无效分蘖，形成叶龄较去年同期增加、总茎蘖数较去年同期减少的生育进程。</textarea></div></div><div data-v-b00fa61e=\"\"><h2 data-v-b00fa61e=\"\">三、田管意见</h2><div data-v-b00fa61e=\"\"><textarea data-v-b00fa61e=\"\" cols=\"30\" rows=\"10\" placeholder=\"请输入对当前问题的对应及下一阶段田管措施\" class=\"textarea\" disabled=\"true\" style=\"\n        width: 98%;\n        border: none;\n        outline: none;\n        border-bottom: 1px solid #000;\n        background:none;\n        height: 30px;\n        line-height: 30px;\n        font-size: 20px;\n        padding-left: 30px;\n        margin: 0 0 10px 0 ;\n        \">1、及时控苗。对大田群体茎蘖总数达标的田块应立即排水烤田控无效分蘖，促使叶色褪淡。一般低洼田块、烂泥田、施肥过重田块、水稻长势过旺田块重晒，砂质田、高塝田、瘦田、水稻长势弱田块轻晒。时间一般10-15天，开始拔节时晒田结束。\n2、抓好直播稻田间管理。6月中下旬直播的田块，及时掌握田间生长情况，搞好恶性杂草防除工作，并及时追施大田分蘖肥，促进大田亩茎蘖数生长达标。\n3、及时防控病虫害。纹枯病、稻叶瘟、稻飞虱、二化螟是本时期高发的病虫害，应随时观察田间生长状况和病虫害发生情况，实施绿色防控和综合防治。 \n4、做好防灾减灾。密切关注最新气象动态，注意灾害天气对水稻田间生长和生产形成的影响，如发生干旱、洪灾等，应及时采取有效措施，降低灾害损失