=\"\" type=\"text\" placeholder=\"请输入当前所处生育期，及天气对苗情长势的影响\" class=\"input\" value=\"根据田间调查，前茬为油菜茬口的中籼稻田块正处于分蘖期，平均叶龄达到5.2叶，亩茎蘖数达到8.9万个；前茬为小麦茬口的中籼稻田块正处于返青期；前茬为绿肥、空闲田的再生稻田块正处于拔节孕穗期，平均叶龄达到15.8叶，亩茎蘖数达19.9万个。\" disabled=\"true\" style=\"\n        width: 98%;\n        border: none;\n        outline: none;\n        border-bottom: 1px solid #000;\n        background:none;\n        height: 30px;\n        line-height: 30px;\n        font-size: 20px;\n        padding-left: 30px;\n        margin: 0 0 10px 0 ;\n        \"></div></div><div data-v-3a5e7bec=\"\"><h2 data-v-3a5e7bec=\"\">二、主要问题</h2><div data-v-3a5e7bec=\"\"><textarea data-v-3a5e7bec=\"\" cols=\"30\" rows=\"10\" placeholder=\"请输入当前生产中遇到的问题\" class=\"textarea\" disabled=\"true\" style=\"\n        width: 98%;\n        border: none;\n        outline: none;\n        border-bottom: 1px solid #000;\n        background:none;\n        height: 30px;\n        line-height: 30px;\n        font-size: 20px;\n        padding-left: 30px;\n        margin: 0 0 10px 0 ;\n        \">1．已进入孕穗期的再生稻田块需保持田间湿润，灌浅水层；栽插较迟的再生稻田块需及时烤田，待烤田结束，及时追施氯化钾。\n2.据区植保站病虫情报，今年我区二化螟较上年发生偏早，零星田块二化螟危害较重；部分岗丘区零星田块发生叶瘟现象。\n</textarea></div></div><div data-v-3a5e7bec=\"\"><h2 data-v-3a5e7bec=\"\">三、田管意见</h2><div data-v-3a5e7bec=\"\"><textarea data-v-3a5e7bec=\"\" cols=\"30\" rows=\"10\" placeholder=\"请输入对当前问题的对应及下一阶段田管措施\" class=\"textarea\" disabled=\"true\" style=\"\n        width: 98%;\n        border: none;\n        outline: none;\n        border-bottom: 1px solid #000;\n        background:none;\n        height: 30px;\n        line-height: 30px;\n        font-size: 20px;\n        padding-left: 30px;\n        margin: 0 0 10px 0 ;\n        \">3.肥料运筹。运用配方施肥技术，按照湾沚区机插秧肥料管理技术规程，施足基肥，及时追施返青肥、分蘖肥，促进秧苗早发快长。\n4.及时除草。要抓住杂草防治最佳时期，根据田间草相，选择安全高效的除草剂及时进行化除、补杀，严格按照产品说明使用，规范操作，防止发生药害。</textarea></div></div>', '2021-12-27 00:00:00', '0221202101', '1');
INSERT INTO `research_report` VALUES ('251', '2021年度双季早稻播栽期苗情', 'crop_01', 'http://139.224.41.123', '<h1 data-v-0a0c2a69=\"\" style=\"width: 80%; margin: 0px auto; text-align: center;\"><input data-v-0a0c2a69=\"\" type=\"text\" value=\"2021年度双季早稻播栽期苗情\" class=\"title\" style=\"width: 70%; font-size: 25px; background: none; text-align: center; border: none;\" disabled=\"true\"></h1><div data-v-0a0c2a69=\"\"><h2 data-v-0a0c2a69=\"\">一、播栽情况</h2><h3 data-v-0a0c2a69=\"\">1．播栽期介绍:</h3><p data-v-0a0c2a69=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n            全县（市、区）早稻育秧（含工厂化育秧）最早播种期在<u data-v-0a0c2a69=\"\">2021-03-20</u>左右，多数播种期集中在\r\n            <input data-v-0a0c2a69=\"\" placeholder=\"手动输入播栽期变化的评价\" type=\"text\" class=\"input\" style=\"\r\n        width: 98%;\r\n        border: none;\r\n        outline: none;\r\n        border-bottom: 1px solid #000;\r\n        background:none;\r\n        height: 30px;\r\n        line-height: 30px;\r\n        font-size: 20px;\r\n        padding-left: 30px;\r\n        margin: 0 0 10px 0 ;\r\n        \" value=\"3月18日至25日\" disabled=\"true\">。\r\n            <input data-v-0a0c2a69=\"\" placeholder=\"手动输入介绍移栽天气及进度\" type=\"text\" class=\"input\" style=\"\r\n        width: 98%;\r\n        border: none;\r\n        outline: none;\r\n        border-bottom: 1px solid #000;\r\n        background:none;\r\n        height: 30px;\r\n        line-height: 30px;\r\n        font-size: 20px;\r\n        padding-left: 30px;\r\n        margin: 0 0 10px 0 ;\r\n        \" value=\"移栽天气较好，总体进度较去年一致\" disabled=\"true\">。\r\n            预计<u data-v-0a0c2a69=\"\">2021-04-25</u>完成移栽。直播早稻播种期时间集中在\r\n            <input data-v-0a0c2a69=\"\" placeholder=\"手动输入介绍\" type=\"text\" class=\"input\" style=\"\r\n        width: 98%;\r\n        border: none;\r\n        outline: none;\r\n        border-bottom: 1px solid #000;\r\n        background:none;\r\n        height: 30px;\r\n        line-height: 30px;\r\n        font-size: 20px;\r\n        padding-left: 30px;\r\n        margin: 0 0 10px 0 ;\r\n        \" value=\"4月8日至12日\" disabled=\"true\">。\r\n        </p><h3 data-v-0a0c2a69=\"\">2．栽培方式介绍:</h3><p data-v-0a0c2a69=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n          全县（市、区）早稻育秧栽插<u data-v-0a0c2a69=\"\">0.00</u>万亩左右，占<u data-v-0a0c2a69=\"\">0.00</u>%,较去年<u data-v-0a0c2a69=\"\">增加0.00</u>万亩；\r\n          其中，移栽 <u data-v-0a0c2a69=\"\">0.00</u>        万亩，抛栽  <u data-v-0a0c2a69=\"\">0.00</u>     万亩，机插秧 <u data-v-0a0c2a69=\"\">0.00</u>      万亩。\r\n          撒直播  <u data-v-0a0c2a69=\"\">0.00</u>    万亩，占<u data-v-0a0c2a69=\"\">0.00</u>    %，较去年<u data-v-0a0c2a69=\"\">增加0.00</u> 万亩。\r\n          <input data-v-0a0c2a69=\"\" placeholder=\"手动输入对栽培方式面积变化的评价\" type=\"text\" class=\"input\" style=\"\r\n        width: 98%;\r\n        border: none;\r\n        outline: none;\r\n        border-bottom: 1px solid #000;\r\n        background:none;\r\n        height: 30px;\r\n        line-height: 30px;\r\n        font-size: 20px;\r\n        padding-left: 30px;\r\n        margin: 0 0 10px 0 ;\r\n        \" value=\"人工撒直播、机条播面积43.2万亩，机插面积6.7万亩，人工抛秧面积2.2万亩\" disabled=\"true\">。\r\n          抛栽、机插秧和撒直播三种种植方式共  <u data-v-0a0c2a69=\"\">0.00</u>     万亩，占总面积 <u data-v-0a0c2a69=\"\">0.00</u>   %，\r\n          比去年<u data-v-0a0c2a69=\"\">增加0.00</u>  万亩。\r\n        </p><h3 data-v-0a0c2a69=\"\">3.3．种植面积介绍</h3><p data-v-0a0c2a69=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n            全县（市、区）今年早稻种植面积<u data-v-0a0c2a69=\"\">1.00</u>万亩，比去年<u data-v-0a0c2a69=\"\">增加0.00</u>万亩，\r\n            <input data-v-0a0c2a69=\"\" placeholder=\"手动输入对种植面积变化的评价\" type=\"text\" class=\"input\" style=\"\r\n        width: 98%;\r\n        border: none;\r\n        outline: none;\r\n        border-bottom: 1px solid #000;\r\n        background:none;\r\n        height: 30px;\r\n        line-height: 30px;\r\n        font-size: 20px;\r\n        padding-left: 30px;\r\n        margin: 0 0 10px 0 ;\r\n        \" value=\"今年我县计划种植面积53.5万亩，较去年增加0.4万亩\" disabled=\"true\">。\r\n        </p></div><div data-v-0a0c2a69=\"\"><h2 data-v-0a0c2a69=\"\">二、主要问题</h2><div data-v-0a0c2a69=\"\"><textarea data-v-0a0c2a69=\"\" cols=\"30\" rows=\"10\" placeholder=\"请输入当前生产中遇到的问题\" class=\"textarea\" disabled=\"true\" style=\"\r\n        width: 98%;\r\n        border: none;\r\n        outline: none;\r\n        border-bottom: 1px solid #000;\r\n        background:none;\r\n        height: 30px;\r\n        line-height: 30px;\r\n        font-size: 20px;\r\n        padding-left: 30px;\r\n        margin: 0 0 10px 0 ;\r\n        \">当前主要问题为直播田除草</textarea></div></div><div data-v-0a0c2a69=\"\"><h2 data-v-0a0c2a69=\"\">三、田管意见</h2><div data-v-0a0c2a69=\"\"><textarea data-v-0a0c2a69=\"\" cols=\"30\" rows=\"10\" placeholder=\"请输入对当前问题的对应及下一阶段田管措施\" class=\"textarea\" disabled=\"true\" style=\"\r\n        width: 98%;\r\n        border: none;\r\n        outline: none;\r\n        border-bottom: 1px solid #000;\r\n        background:none;\r\n        height: 30px;\r\n        line-height: 30px;\r\n        font-size: 20px;\r\n        padding-left: 30px;\r\n        margin: 0 0 10px 0 ;\r\n        \">一是直播田块。叶龄3叶1心期亩施尿素5-7公斤，同时重点做好除草工作；叶龄达到5-6叶期，亩施尿素6-7公斤，氯化钾3-4公斤。二是对刚抛栽或机插田块，田间保持浅水层，养根护苗，栽后5-6天，亩施尿素6-7公斤，氯化钾3-4公斤。</textarea></div></div>', '2021-12-27 00:00:00', '0124202101', '1');
INSERT INTO `research_report` VALUES ('252', '2021年度一季稻分孽期苗情', 'crop_01', 'http://139.224.41.123', '<h1 data-v-6819bd31=\"\" style=\"width: 80%; margin: 0px auto; text-align: center;\"><input data-v-6819bd31=\"\" type=\"text\" value=\"2021年度一季稻分孽期苗情\" class=\"title\" style=\"width: 70%; background: none; font-size: 25px; text-align: center; border: none;\" disabled=\"true\"></h1><div data-v-6819bd31=\"\"><h2 data-v-6819bd31=\"\">一、当前苗情</h2><h3 data-v-6819bd31=\"\">1．栽插穴数、基本苗介绍:</h3><p data-v-6819bd31=\"\">\n          &nbsp;&nbsp;<span data-v-6819bd31=\"\" style=\"font-weight: bold;\">中籼稻：</span>\n          育苗移栽（人工移栽+机插秧+盘育抛栽）的平均亩栽 <u data-v-6819bd31=\"\">1.60</u> 万穴，比去年 <u data-v-6819bd31=\"\">增加1.60</u> 万穴，\n          基本苗 <u data-v-6819bd31=\"\">4.90</u>  万，比去年<u data-v-6819bd31=\"\">增加4.90</u>  万。\n          其中，人工移栽的平均亩栽  <u data-v-6819bd31=\"\">0.00</u>  万穴，亩基本苗 <u data-v-6819bd31=\"\">0.00</u> 万；\n          机插的平均亩栽 <u data-v-6819bd31=\"\">1.60</u> 万穴，亩基本苗 <u data-v-6819bd31=\"\">4.90</u>  万；\n          盘育抛栽的平均亩栽 <u data-v-6819bd31=\"\">0.00</u> 万穴，亩基本苗 <u data-v-6819bd31=\"\">0.00</u>万。\n          直播的平均亩基本苗 <u data-v-6819bd31=\"\">0.00</u> 万，比去年<u data-v-6819bd31=\"\">减少0.00</u>万亩    。\n        </p><p data-v-6819bd31=\"\">\n          &nbsp;&nbsp;<span data-v-6819bd31=\"\" style=\"font-weight: bold;\">中粳稻：</span>\n          育苗移栽的平均亩栽 <u data-v-6819bd31=\"\">0.00</u> 万穴，比去年 <u data-v-6819bd31=\"\">减少0.00</u> 万穴，\n          基本苗 <u data-v-6819bd31=\"\">0.00</u>  万，比去年<u data-v-6819bd31=\"\">减少0.00</u>  万。\n          其中，人工移栽的平均亩栽  <u data-v-6819bd31=\"\">0.00</u>  万穴，亩基本苗 <u data-v-6819bd31=\"\">0.00</u> 万；\n          机插的平均亩栽 <u data-v-6819bd31=\"\">0.00</u> 万穴，亩基本苗 <u data-v-6819bd31=\"\">0.00</u>  万；\n          直播的平均亩基本苗 <u data-v-6819bd31=\"\">0.00</u> 万，比去年<u data-v-6819bd31=\"\">减少0.00</u>万亩    。\n        </p><h3 data-v-6819bd31=\"\">2．叶龄、群体茎蘖数介绍</h3><p data-v-6819bd31=\"\">\n          &nbsp;&nbsp;<span data-v-6819bd31=\"\" style=\"font-weight: bold;\">中籼稻：</span>移栽（人工移栽+机插秧+盘育抛栽）的主茎叶龄<u data-v-6819bd31=\"\">0.00</u>叶，比去年<u data-v-6819bd31=\"\">减少0.00</u> 叶；\n          平均亩茎蘖数 <u data-v-6819bd31=\"\">0.00</u> 万，比去年<u data-v-6819bd31=\"\">减少0.00</u>  万。\n          其中，人工栽插的主茎叶龄<u data-v-6819bd31=\"\">0.00</u>叶，平均亩茎蘖数<u data-v-6819bd31=\"\">0.00</u> 万；\n          机械栽插主茎叶龄<u data-v-6819bd31=\"\">0.00</u>叶，平均亩茎蘖数<u data-v-6819bd31=\"\">0.00</u> 万；\n          抛栽的主茎叶龄<u data-v-6819bd31=\"\">0.00</u>叶，平均亩茎蘖数<u data-v-6819bd31=\"\">0.00</u> 万。\n          直播的主茎叶龄<u data-v-6819bd31=\"\">0.00</u>叶，比去年<u data-v-6819bd31=\"\">减少0.00</u> 叶；\n          平均亩茎蘖数 <u data-v-6819bd31=\"\">0.00</u>万，比去年<u data-v-6819bd31=\"\">减少0.00</u>万。\n        </p><p data-v-6819bd31=\"\">\n          &nbsp;&nbsp;<span data-v-6819bd31=\"\" style=\"font-weight: bold;\">中粳稻：</span>移栽（人工移栽+机插秧+盘育抛栽）的主茎叶龄<u data-v-6819bd31=\"\">0.00</u>叶，比去年<u data-v-6819bd31=\"\">减少0.00</u> 叶；\n          平均亩茎蘖数 <u data-v-6819bd31=\"\">0.00</u> 万，比去年<u data-v-6819bd31=\"\">减少0.00</u>  万。\n          其中，人工栽插的主茎叶龄<u data-v-6819bd31=\"\">0.00</u>叶，平均亩茎蘖数<u data-v-6819bd31=\"\">0.00</u> 万；\n          机械栽插主茎叶龄<u data-v-6819bd31=\"\">0.00</u>叶，平均亩茎蘖数<u data-v-6819bd31=\"\">0.00</u> 万；\n          直播的主茎叶龄<u data-v-6819bd31=\"\">0.00</u>叶，比去年<u data-v-6819bd31=\"\">减少0.00</u> 叶；\n          平均亩茎蘖数 <u data-v-6819bd31=\"\">0.00</u>万，比去年<u data-v-6819bd31=\"\">减少0.00</u>万。\n        </p><h3 data-v-6819bd31=\"\">3．面上苗情</h3><p data-v-6819bd31=\"\">\n          全县（市、区）一季稻面积<input data-v-6819bd31=\"\" type=\"text\" style=\"width: 50px; background: none; border-top: none; border-right: none; border-bottom: 1px solid rgb(0, 0, 0); border-left: none; border-image: initial; font-size: 18px; outline: none;\" disabled=\"true\" value=\"14.00\">万亩，\n          较去年<input data-v-6819bd31=\"\" type=\"text\" style=\"width: 60px; border-top: none; border-right: none; border-bottom: 1px solid rgb(0, 0, 0); border-left: none; border-image: initial; font-size: 18px; outline: none;\" disabled=\"true\" value=\"增长0.5\">  万亩，\n          \n          一类苗占 <u data-v-6819bd31=\"\">NaN</u>%，二类苗占<u data-v-6819bd31=\"\">NaN</u>%，三类苗占<u data-v-6819bd31=\"\">NaN</u>%。\n          一、二类苗占<u data-v-6819bd31=\"\">NaN</u> %，比去年<u data-v-6819bd31=\"\">增加0.00</u>   个百分点，\n          <span data-v-6819bd31=\"\">苗情长势:</span><input data-v-6819bd31=\"\" type=\"text\" placeholder=\"请输入对当前苗情长势的评价\" style=\"width: 71%; height: 30px; background: none; border-top: none; border-right: none; border-bottom: 1px solid rgb(0, 0, 0); border-left: none; border-image: initial; font-size: 18px; outline: none;\" value=\"全区一类苗的面积为7.42万亩，二类苗面积为5.6万亩，三类苗面积为0.98万亩，占比为0.53:0.40:0.07，与上年基本持平。\" disabled=\"true\"></p></div><div data-v-6819bd31=\"\"><h2 data-v-6819bd31=\"\">二、主要问题</h2><div data-v-6819bd31=\"\"><textarea data-v-6819bd31=\"\" cols=\"30\" rows=\"10\" placeholder=\"请输入当前生产中遇到的问题\" class=\"textarea\" disabled=\"true\" style=\"\n        width: 98%;\n        border: none;\n        outline: none;\n        border-bottom: 1px solid #000;\n        background:none;\n        height: 30px;\n        line-height: 30px;\n        font-size: 20px;\n        padding-left: 30px;\n        margin: 0 0 10px 0 ;\n        \">自6月入梅以来，降雨量将往年有所减少，河道、内塘水位均不高，当前我区的水稻生产并无洪涝灾害影响。\n截止7月8日，再生稻模式前茬已进入抽穗期，根据气象部门预报，7月中下旬，有连续高温天气，不利于再生稻前茬灌浆结实。根据气象部门预测预报，7月中、下旬有连续降雨天气，油菜茬口和小麦茬口的中籼稻正处于分蘖拔节期，水稻生长浓密茂盛，有利于二化螟的繁殖危害。</textarea></div></div><div data-v-6819bd31=\"\"><h2 data-v-6819bd31=\"\">三、田管意见</h2><div data-v-6819bd31=\"\"><textarea data-v-6819bd31=\"\" cols=\"30\" rows=\"10\" placeholder=\"请输入对当前问题的对应及下一阶段田管措施\" class=\"textarea\" disabled=\"true\" style=\"\n        width: 98%;\n        border: none;\n        outline: none;\n        border-bottom: 1px solid #000;\n        background:none;\n        height: 30px;\n        line-height: 30px;\n        font-size: 20px;\n        padding-left: 30px;\n        margin: 0 0 10px 0 ;\n        \">根据气象部门预测预报，七月中下旬既有连续高温天气，也有连续降雨天气，不同模式的单季稻田块处于的生育期也不同，根据不同的情况，提出以下几点建议：\n1、田间管理：当前再生稻模式前茬已进入抽穗期，在田间管理方面，要注意保持田间湿润，白天保持浅水层，晚上将水排出,防止长时间泡在水中，土壤淤陷，导致后期收割时，碾压面积过大。油菜茬口和小麦茬口的中籼稻已陆续进入烤田期，需要注意利用晴好天气，及时排水烤田，烤田结束后，及时追施氯化钾和尿素。\n2、病虫防控：根据植保站病虫情报预报，二代二化螟在单季杂交稻田中等发生，在7月18—23日，利用晴好天气及时喷施苏云金杆菌或阿维菌素，防治二化螟，按登记用量混配，兑水喷雾，不同农药轮换使用，保持田间水层4—5天。</textarea></div></div>', '2021-12-28 00:00:00', '0221202101', '1');
INSERT INTO `research_report` VALUES ('253', '2021年度一季稻抽穗期苗情（一）', 'crop_01', 'http://139.224.41.123', '<h1 data-v-37fd2f42=\"\" style=\"width: 80%; margin: 0px auto; text-align: center;\"><input data-v-37fd2f42=\"\" type=\"text\" value=\"2021年度一季稻抽穗期苗情（一）\" class=\"title\" style=\"width: 70%; font-size: 25px; text-align: center; border: none; font-weight: bold;\" disabled=\"true\"></h1><h1 data-v-37fd2f42=\"\" style=\"width: 50%; margin: 0px auto; text-align: center; font-size: 23px;\">一季稻生育进程及高温热害的影响</h1><div data-v-37fd2f42=\"\"><h2 data-v-37fd2f42=\"\">一、当前苗情</h2><h3 data-v-37fd2f42=\"\">1．生育进程</h3><p data-v-37fd2f42=\"\" style=\"font-size: 20px; line-height: 30px;\">\n          &nbsp;&nbsp;全县（市、区）一季稻面积<input data-v-37fd2f42=\"\" type=\"text\" style=\"width: 40px; background: none; border-top: none; border-right: none; border-bottom: 1px solid rgb(0, 0, 0); border-left: none; border-image: initial; font-size: 20px; outline: none;\" value=\"14\" disabled=\"true\">万亩，\n          较去年<input data-v-37fd2f42=\"\" type=\"text\" style=\"width: 100px; border-top: none; border-right: none; border-bottom: 1px solid rgb(0, 0, 0); border-left: none; border-image: initial; background: none; font-size: 20px; outline: none;\" value=\"增长0.5\" disabled=\"true\">万亩。\n          8月20日前全省处在抽穗扬花至灌浆期的一季稻 <u data-v-37fd2f42=\"\">14.0</u> 万亩左右，占总面积 <u data-v-37fd2f42=\"\">100.0</u> %，比去年 <u data-v-37fd2f42=\"\">增加0.0</u> 个百分点；\n          预计8月下旬至9月上中旬抽穗扬花的<u data-v-37fd2f42=\"\">0.0</u> 万亩左右，占总面积 <u data-v-37fd2f42=\"\">0.0</u> %，比去年 <u data-v-37fd2f42=\"\">增加0.00</u> 个百分点；\n        </p><h3 data-v-37fd2f42=\"\">2．不同时段抽穗的产量水平</h3><p data-v-37fd2f42=\"\" style=\"font-size: 20px; line-height: 30px;\">\n          &nbsp;&nbsp;其中，7月31日前抽穗扬花的，约 <u data-v-37fd2f42=\"\">1.7</u> 万亩左右，占 <u data-v-37fd2f42=\"\">增加0.0</u>%，\n          <input data-v-37fd2f42=\"\" type=\"text\" placeholder=\"请输入分布地区、前茬类型及当前天气对抽穗扬花的评价\" style=\"width: 98%;\" value=\"六郎、红杨地区，前茬为油菜，今年入汛以来，我区范围内无连续阴雨天气和极端天气，台风“烟花”也未经过我区，没有造成不利影响。\" disabled=\"true\">\n\n          &nbsp;&nbsp;据调查，平均亩有效穗<u data-v-37fd2f42=\"\">16.8</u> 万，每穗总粒数 <u data-v-37fd2f42=\"\">195.0</u>粒，结实率 <u data-v-37fd2f42=\"\">80.8</u>%，\n          千粒重按 <u data-v-37fd2f42=\"\">26.0</u> 克计，理论亩产 <u data-v-37fd2f42=\"\">5.8</u>公斤，比去年同期（<u data-v-37fd2f42=\"\">0.0</u>公斤）<u data-v-37fd2f42=\"\"></u> %\n        </p><p data-v-37fd2f42=\"\" style=\"font-size: 20px; line-height: 30px;\">\n          &nbsp;&nbsp;其中，8月上旬抽穗扬花的中籼稻，全县（市、区）约 <u data-v-37fd2f42=\"\">11.4</u> 万亩左右，占 <u data-v-37fd2f42=\"\">81.4</u>%，\n          <input data-v-37fd2f42=\"\" type=\"text\" placeholder=\"请输入分布地区、前茬类型及当前天气对抽穗扬花的评价\" style=\"width: 98%;\" value=\"花桥、湾沚地区，前茬为油菜，今年入汛以来，我区范围内无连续阴雨天气和极端天气，台风“烟花”也未经过我区，没有造成不利影响。\" disabled=\"true\">\n\n          &nbsp;&nbsp;据初步调查，\n          \n          结实率 <u data-v-37fd2f42=\"\">58.1</u>%，\n          </p><p data-v-37fd2f42=\"\" style=\"font-size: 20px; line-height: 30px;\">\n          &nbsp;&nbsp;8月中下旬抽穗扬花的中籼稻，全县（市、区）约 <u data-v-37fd2f42=\"\">0.9</u> 万亩，占 <u data-v-37fd2f42=\"\">6.4 </u>%。\n          <input data-v-37fd2f42=\"\" type=\"text\" placeholder=\"手动输入分布地区、前茬类型及当前天气对抽穗扬花的评价\" value=\"六郎、陶辛地区，前茬为油菜，今年入汛以来，我区范围内无连续阴雨天气和极端天气，台风“烟花”也未经过我区，没有造成不利影响。\" disabled=\"true\"></p><p data-v-37fd2f42=\"\" style=\"font-size: 20px; line-height: 30px;\">\n          &nbsp;&nbsp;9月上中旬抽穗扬花的中籼稻，全县（市、区） <u data-v-37fd2f42=\"\">0.0</u> 万亩，约占 <u data-v-37fd2f42=\"\">0.0 </u>%。\n          <input data-v-37fd2f42=\"\" type=\"text\" placeholder=\"手动输入分布地区、前茬类型及当前天气对抽穗扬花的评价\" value=\"红杨、湾沚三元地区，前茬为油菜，今年入汛以来，我区范围内无连续阴雨天气和极端天气，台风“烟花”也未经过我区，没有造成不利影响。\" disabled=\"true\"></p><h3 data-v-37fd2f42=\"\">3．叶龄、群体茎蘖数</h3><p data-v-37fd2f42=\"\"><span data-v-37fd2f42=\"\" style=\"font-weight: bold;\">籼稻:</span> 移栽的平均亩茎蘖数<u data-v-37fd2f42=\"\">0</u>万，与去年同期<u data-v-37fd2f42=\"\">多0</u>万；\n            叶龄<u data-v-37fd2f42=\"\">0</u>叶，较去年同期 <u data-v-37fd2f42=\"\">多0</u>  叶。\n            其中，人工移栽的平均亩茎蘖数为 <u data-v-37fd2f42=\"\">0</u>万，叶龄<u data-v-37fd2f42=\"\">0</u> 叶；\n            机插的平均亩茎蘖数 <u data-v-37fd2f42=\"\">0</u> 万，叶龄 <u data-v-37fd2f42=\"\">0</u> 叶；\n            抛栽的平均亩茎蘖数 <u data-v-37fd2f42=\"\">0</u> 万，叶龄 <u data-v-37fd2f42=\"\">0</u> 叶。\n            直播的平均亩茎蘖数<u data-v-37fd2f42=\"\">0</u>万，较去年<u data-v-37fd2f42=\"\">多0</u>万；\n            叶龄<u data-v-37fd2f42=\"\">0</u>叶，较去年<u data-v-37fd2f42=\"\">多0</u>叶。\n        </p><p data-v-37fd2f42=\"\"><span data-v-37fd2f42=\"\" style=\"font-weight: bold;\">粳稻:</span>以常规粳稻为主，移栽的平均亩茎蘖数<u data-v-37fd2f42=\"\">0</u>万，与去年同期<u data-v-37fd2f42=\"\">多0</u>万；\n            叶龄<u data-v-37fd2f42=\"\">0</u>叶，较去年同期 <u data-v-37fd2f42=\"\">多0</u>  叶。\n            其中，人工移栽的平均亩茎蘖数为 <u data-v-37fd2f42=\"\">0</u>万，叶龄<u data-v-37fd2f42=\"\">0</u> 叶；\n            机插的平均亩茎蘖数 <u data-v-37fd2f42=\"\">0</u> 万，叶龄 <u data-v-37fd2f42=\"\">0</u> 叶；\n            抛栽的平均亩茎蘖数 <u data-v-37fd2f42=\"\">0</u> 万，叶龄 <u data-v-37fd2f42=\"\">0</u> 叶。\n            直播的平均亩茎蘖数<u data-v-37fd2f42=\"\">0</u>万，较去年<u data-v-37fd2f42=\"\">多0</u>万；\n            叶龄<u data-v-37fd2f42=\"\">0</u>叶，较去年<u data-v-37fd2f42=\"\">多0</u>叶。\n        </p></div><div data-v-37fd2f42=\"\"><h2 data-v-37fd2f42=\"\">二、当前预估产分析</h2><div data-v-37fd2f42=\"\"><textarea data-v-37fd2f42=\"\" cols=\"30\" rows=\"10\" placeholder=\"输入本生产季天气状况对水稻生产的影响，及当前生产中遇到的问题\" class=\"textarea\" disabled=\"true\" style=\"\n        width: 98%;\n        border: none;\n        outline: none;\n        border-bottom: 1px solid #000;\n        background:none;\n        height: 30px;\n        line-height: 30px;\n        font-size: 20px;\n        padding-left: 30px;\n        margin: 0 0 10px 0 ;\n        \">根据田间调查，当前再生稻模式头茬已陆续进入收割期，如遇连续阴雨天，再生稻头茬来不及收割，容易导致再生稻后茬休眠芽萌发受影响，连续阴雨天也会导致田间淤陷，收割机作业时，车轮过多碾压水稻植株，导致后期减产，不过根据气象部门预测预报八月中下旬无连续降雨和极端高温天气，有利于再生稻头茬收割。\n油菜茬口和小麦茬口的中稻正处于孕穗期和孕穗末期，需要注意田间保持浅水层，供水稻生长，及时喷施对路农药，预防穗期病害。</textarea></div></div><div data-v-37fd2f42=\"\"><h2 data-v-37fd2f42=\"\">三、田管意见</h2><div data-v-37fd2f42=\"\"><textarea data-v-37fd2f42=\"\" cols=\"30\" rows=\"10\" placeholder=\"请输入对当前问题的对应及下一阶段田管措施\" class=\"textarea\" disabled=\"true\" style=\"\n        width: 98%;\n        border: none;\n        outline: none;\n        border-bottom: 1px solid #000;\n        background:none;\n        height: 30px;\n        line-height: 30px;\n        font-size: 20px;\n        padding-left: 30px;\n        margin: 0 0 10px 0 ;\n        \">当前再生稻模式的中稻前茬已陆续进入收割期，需注意当大田90%稻穗成熟时，利用晴好天气，即可收割，确保收获时秆青籽黄；严格规划收割路线，避免收割机过多碾压，留茬高度25-30厘米，收获后当天复水,及时追肥。油菜茬口和小麦茬口的中稻正处于孕穗期和孕穗末期，注意田间保持浅水层，供水稻生长。</textarea></div></div>', '2021-12-28 00:00:00', '0221202101', '1');
INSERT INTO `research_report` VALUES ('254', '2021年度一季稻抽穗期苗情（二）', 'crop_01', 'http://139.224.41.123', '<h1 data-v-6db856a4=\"\" style=\"width: 80%; margin: 0px auto; text-align: center;\"><input data-v-6db856a4=\"\" type=\"text\" value=\"2021年度一季稻抽穗期苗情（二）\" class=\"title\" style=\"width: 70%; font-size: 25px; background: none; text-align: center; border: none; font-weight: bold;\" disabled=\"true\"></h1><h1 data-v-6db856a4=\"\" style=\"width: 50%; margin: 0px auto; text-align: center; font-size: 23px;\">一季稻生育进程及高温热害的影响</h1><div data-v-6db856a4=\"\"><h2 data-v-6db856a4=\"\">一、当前苗情</h2><h3 data-v-6db856a4=\"\">1．生育进程</h3><p data-v-6db856a4=\"\" style=\"font-size: 20px; line-height: 30px;\">\n          &nbsp;&nbsp;全县（市、区）一季稻面积<input data-v-6db856a4=\"\" type=\"text\" style=\"width: 40px; border-top: none; border-right: none; border-bottom: 1px solid rgb(0, 0, 0); border-left: none; border-image: initial; font-size: 20px; outline: none;\" value=\"14\" disabled=\"true\">万亩，\n          与去年相比<input data-v-6db856a4=\"\" type=\"text\" style=\"width: 100px; border-top: none; border-right: none; border-bottom: 1px solid rgb(0, 0, 0); border-left: none; border-image: initial; font-size: 20px; outline: none;\" value=\"增长0.5\" disabled=\"true\">万亩。\n          8月20日前全省处在抽穗扬花至灌浆期的一季稻 <u data-v-6db856a4=\"\">14.0</u> 万亩左右，占总面积 <u data-v-6db856a4=\"\">100.0</u> %，比去年 <u data-v-6db856a4=\"\">增加0.0</u> 个百分点；\n          预计8月下旬至9月上中旬抽穗扬花的<u data-v-6db856a4=\"\">0.0</u> 万亩左右，占总面积 <u data-v-6db856a4=\"\">0.0</u> %，比去年 <u data-v-6db856a4=\"\">增加0.00</u> 个百分点；\n        </p><h3 data-v-6db856a4=\"\">2．不同时段抽穗的产量水平</h3><p data-v-6db856a4=\"\" style=\"font-size: 20px; line-height: 30px;\">\n          &nbsp;&nbsp;其中，7月31日前抽穗扬花的，约 <u data-v-6db856a4=\"\">1.7</u> 万亩左右，占 <u data-v-6db856a4=\"\">12.0</u>%，\n\n          <input data-v-6db856a4=\"\" type=\"text\" placeholder=\"请输入分布地区、前茬类型及当前天气对抽穗扬花的评价\" style=\"width: 98%;\" value=\"六郎、红杨地区，前茬为油菜，今年入汛以来，我区范围内无连续阴雨天气和极端天气，台风“烟花”也未经过我区，没有造成不利影响。\" disabled=\"true\">\n          &nbsp;&nbsp;据调查，平均亩有效穗<u data-v-6db856a4=\"\">16.8</u> 万，每穗总粒数 <u data-v-6db856a4=\"\">195.0</u>粒，结实率 <u data-v-6db856a4=\"\">80.8</u>%，\n          千粒重按 <u data-v-6db856a4=\"\">26.0</u> 克计，理论亩产 <u data-v-6db856a4=\"\">5.8</u>公斤，比去年同期（<u data-v-6db856a4=\"\">0.0</u>公斤）<u data-v-6db856a4=\"\">增加0.00</u> %\n        </p><p data-v-6db856a4=\"\" style=\"font-size: 20px; line-height: 30px;\">\n          &nbsp;&nbsp;8月上旬抽穗扬花的中籼稻，全县（市、区）约 <u data-v-6db856a4=\"\">11.4</u> 万亩，占 <u data-v-6db856a4=\"\">81.4 </u>%，据初步调查，结实率 <u data-v-6db856a4=\"\">174.4</u> %。\n          <input data-v-6db856a4=\"\" type=\"text\" placeholder=\"输入分布地区、前茬类型及当前天气对抽穗扬花的评价\" value=\"花桥、湾沚地区，前茬为油菜，今年入汛以来，我区范围内无连续阴雨天气和极端天气，台风“烟花”也未经过我区，没有造成不利影响\" disabled=\"true\"></p><p data-v-6db856a4=\"\" style=\"font-size: 20px; line-height: 30px;\">\n          &nbsp;&nbsp;8月中下旬抽穗扬花的中籼稻，全县（市、区）约 <u data-v-6db856a4=\"\">11.4</u> 万亩，占 <u data-v-6db856a4=\"\">81.4 </u>%。\n          <input data-v-6db856a4=\"\" type=\"text\" placeholder=\"手动输入分布地区、前茬类型及当前天气对抽穗扬花的评价\" value=\"六郎、陶辛地区，前茬为油菜，今年入汛以来，我区范围内无连续阴雨天气和极端天气，台风“烟花”也未经过我区，没有造成不利影响\" disabled=\"true\"></p><p data-v-6db856a4=\"\" style=\"font-size: 20px; line-height: 30px;\">\n          &nbsp;&nbsp;9月上中旬抽穗扬花的中籼稻，全省约 <u data-v-6db856a4=\"\">0.0</u> 万亩，占 <u data-v-6db856a4=\"\">0.0 </u>%。\n          <input data-v-6db856a4=\"\" type=\"text\" placeholder=\"手动输入分布地区、前茬类型及当前天气对抽穗扬花的评价\" value=\"花桥、湾沚三元地区，前茬为油菜，今年入汛以来，我区范围内无连续阴雨天气和极端天气，台风“烟花”也未经过我区，没有造成不利影响\" disabled=\"true\"></p></div><div data-v-6db856a4=\"\"><h2 data-v-6db856a4=\"\">二、当前预估产分析</h2><div data-v-6db856a4=\"\"><textarea data-v-6db856a4=\"\" cols=\"30\" rows=\"10\" placeholder=\"输入本生产季天气状况对水稻生产的影响，及当前生产中遇到的问题\" class=\"textarea\" disabled=\"true\" style=\"\n        width: 98%;\n        border: none;\n        outline: none;\n        border-bottom: 1px solid #000;\n        background:none;\n        height: 30px;\n        line-height: 30px;\n        font-size: 20px;\n        padding-left: 30px;\n        margin: 0 0 10px 0 ;\n        \">根据气象部门统计，湾沚区8月10—16日，期间持续降雨，部分再生稻头季田块来不及收割，导致0.1万亩穗发芽。\n今年8月中、下旬的田间理论产量较上年增长，主要是因为这段时间无特殊天气影响，气候适宜，未有持续的超过35℃以上高温天气，无高温热害，利于水稻抽穗扬花和灌浆结实。</textarea></div></div><div data-v-6db856a4=\"\"><h2 data-v-6db856a4=\"\">三、田管意见</h2><div data-v-6db856a4=\"\"><textarea data-v-6db856a4=\"\" cols=\"30\" rows=\"10\" placeholder=\"请输入对当前问题的对应及下一阶段田管措施\" class=\"textarea\" disabled=\"true\" style=\"\n        width: 98%;\n        border: none;\n        outline: none;\n        border-bottom: 1px solid #000;\n        background:none;\n        height: 30px;\n        line-height: 30px;\n        font-size: 20px;\n        padding-left: 30px;\n        margin: 0 0 10px 0 ;\n        \">现阶段，我区大多水稻处于抽穗扬花期，要加强田间肥水调控，要注重水层管理及保证养分供应，田间管理以养根保叶、防止早衰、提高光合效率、促进灌浆、提高结实率和粒重为目标。\n合理灌溉灌浆水。灌浆结实期合理灌溉，可以养根保叶、减少空粒和秕粒。抽穗扬花期田间要保持一定水层。灌浆期以湿润为主，间隙灌溉，以保持根系活力。扬花期遇高温或结实期遇低温，要及早灌深水调节温度，以减少空粒和秕粒。收割前不宜过早断水，一般在收获前一周开沟断水。</textarea></div></div>', '2021-12-28 00:00:00', '0221202101', '1');
INSERT INTO `research_report` VALUES ('255', '2021年度一季稻抽穗期苗情（三）', 'crop_01', 'http://139.224.41.123', '<h1 data-v-2497e5b3=\"\" style=\"width: 80%; margin: 0px auto; text-align: center;\"><input data-v-2497e5b3=\"\" type=\"text\" value=\"2021年度一季稻抽穗期苗情（三）\" class=\"title\" style=\"width: 70%; background: none; font-size: 25px; text-align: center; border: none; font-weight: bold;\" disabled=\"true\"></h1><h1 data-v-2497e5b3=\"\" style=\"width: 50%; margin: 0px auto; text-align: center; font-size: 23px;\">一季稻生育进程及高温热害的影响</h1><div data-v-2497e5b3=\"\"><h2 data-v-2497e5b3=\"\">一、当前苗情</h2><h3 data-v-2497e5b3=\"\">1．生育进程</h3><p data-v-2497e5b3=\"\" style=\"font-size: 20px; line-height: 30px;\">\n          &nbsp;&nbsp;全县（市、区）一季稻面积<input data-v-2497e5b3=\"\" type=\"text\" style=\"width: 40px; background: none; border-top: none; border-right: none; border-bottom: 1px solid rgb(0, 0, 0); border-left: none; border-image: initial; font-size: 20px; outline: none;\" value=\"14\" disabled=\"true\">万亩，\n          与去年相比<input data-v-2497e5b3=\"\" type=\"text\" style=\"width: 100px; background: none; border-top: none; border-right: none; border-bottom: 1px solid rgb(0, 0, 0); border-left: none; border-image: initial; font-size: 20px; outline: none;\" value=\"增加0.5\" disabled=\"true\">万亩。\n          8月20日前全省处在抽穗扬花至灌浆期的一季稻 <u data-v-2497e5b3=\"\">14.0</u> 万亩左右，占总面积 <u data-v-2497e5b3=\"\">100.0</u> %，比去年 <u data-v-2497e5b3=\"\">增加0.00</u> 个百分点；\n          预计8月下旬至9月上中旬抽穗扬花的<u data-v-2497e5b3=\"\">0.0</u> 万亩左右，占总面积 <u data-v-2497e5b3=\"\">0.0</u> %，比去年 <u data-v-2497e5b3=\"\">增加0.00</u> 个百分点；\n        </p><h3 data-v-2497e5b3=\"\">2．不同时段抽穗的产量水平</h3><p data-v-2497e5b3=\"\" style=\"font-size: 20px; line-height: 30px;\">\n          &nbsp;&nbsp;其中，7月31日前抽穗扬花的，约 <u data-v-2497e5b3=\"\">1.7</u> 万亩左右，占 <u data-v-2497e5b3=\"\">12.0</u>%，\n          <input data-v-2497e5b3=\"\" type=\"text\" placeholder=\"请输入分布地区、前茬类型及当前天气对抽穗扬花的评价\" style=\"width: 98%;\" value=\"根据气象部门预报，9月中下旬无明显高温等极端天气，无不利于一季稻抽穗扬花、灌浆、成熟收获的因素。\" disabled=\"true\">\n          &nbsp;&nbsp;据调查，平均亩有效穗<u data-v-2497e5b3=\"\">16.8</u> 万，每穗总粒数 <u data-v-2497e5b3=\"\"></u>粒，结实率 <u data-v-2497e5b3=\"\">80.8</u>%，\n          千粒重按 <u data-v-2497e5b3=\"\">26.0</u> 克计，理论亩产 <u data-v-2497e5b3=\"\">5.8</u>公斤，比去年同期（<u data-v-2497e5b3=\"\">0.0</u>公斤）<u data-v-2497e5b3=\"\">增加0.00</u> %\n        </p><p data-v-2497e5b3=\"\" style=\"font-size: 20px; line-height: 30px;\">\n          &nbsp;&nbsp;其中，8月上旬抽穗扬花的中籼稻，约 <u data-v-2497e5b3=\"\">11.4</u> 万亩左右，占 <u data-v-2497e5b3=\"\">81.4</u>%，\n          <input data-v-2497e5b3=\"\" type=\"text\" placeholder=\"请输入分布地区、前茬类型及当前天气对抽穗扬花的评价\" style=\"width: 98%;\" value=\"根据气象部门预报，9月中下旬无明显高温等极端天气，无不利于一季稻抽穗扬花、灌浆、成熟收获的因素。\" disabled=\"true\">\n          &nbsp;&nbsp;据调查，平均亩有效穗<u data-v-2497e5b3=\"\">31.8</u> 万，每穗总粒数 <u data-v-2497e5b3=\"\"></u>粒，结实率 <u data-v-2497e5b3=\"\">174.4</u>%，\n          千粒重按 <u data-v-2497e5b3=\"\">52.0</u> 克计，理论亩产 <u data-v-2497e5b3=\"\">12.2</u>公斤，比去年同期（<u data-v-2497e5b3=\"\">0.0</u>公斤）<u data-v-2497e5b3=\"\">增加0.00</u> %\n        </p><p data-v-2497e5b3=\"\" style=\"font-size: 20px; line-height: 30px;\">\n          &nbsp;&nbsp;其中，8月下旬抽穗扬花的中籼稻，约 <u data-v-2497e5b3=\"\">0.9</u> 万亩左右，占 <u data-v-2497e5b3=\"\"></u>%，\n          <input data-v-2497e5b3=\"\" type=\"text\" placeholder=\"请输入分布地区、前茬类型及当前天气对抽穗扬花的评价\" style=\"width: 98%;\" value=\"根据气象部门预报，9月中下旬无明显高温等极端天气，无不利于一季稻抽穗扬花、灌浆、成熟收获的因素。\" disabled=\"true\">\n          &nbsp;&nbsp;据调查，平均亩有效穗<u data-v-2497e5b3=\"\">15.6</u> 万，每穗总粒数 <u data-v-2497e5b3=\"\"></u>粒，结实率 <u data-v-2497e5b3=\"\">88.1</u>%，\n          千粒重按 <u data-v-2497e5b3=\"\">26.0</u> 克计，理论亩产 <u data-v-2497e5b3=\"\">6.1</u>公斤，比去年同期（<u data-v-2497e5b3=\"\">0.0</u>公斤）<u data-v-2497e5b3=\"\">增加0.00</u> %\n        </p><p data-v-2497e5b3=\"\" style=\"font-size: 20px; line-height: 30px;\">\n          &nbsp;&nbsp;9月上中旬抽穗扬花的中籼稻，全县（市、区）约 <u data-v-2497e5b3=\"\">0.0</u> 万亩，占 <u data-v-2497e5b3=\"\">0.0 </u>%。\n          <input data-v-2497e5b3=\"\" type=\"text\" placeholder=\"手动输入分布地区、前茬类型及当前天气对抽穗扬花的评价\" value=\"根据气象部门预报，9月中下旬无明显高温等极端天气，无不利于一季稻抽穗扬花、灌浆、成熟收获的因素。\" disabled=\"true\"></p></div><div data-v-2497e5b3=\"\"><h2 data-v-2497e5b3=\"\">二、当前预估产分析</h2><div data-v-2497e5b3=\"\"><textarea data-v-2497e5b3=\"\" cols=\"30\" rows=\"10\" placeholder=\"输入本生产季天气状况对水稻生产的影响，及当前生产中遇到的问题\" class=\"textarea\" disabled=\"true\" style=\"\n        width: 98%;\n        border: none;\n        outline: none;\n        border-bottom: 1px solid #000;\n        background:none;\n        height: 30px;\n        line-height: 30px;\n        font-size: 20px;\n        padding-left: 30px;\n        margin: 0 0 10px 0 ;\n        \">由于9月上旬干燥无雨，再生稻后茬正处于抽穗扬花期，缺水易受损，一季稻正处于蜡熟期，也需要田间保持湿润，后期持续无雨的话，会导致结实率降低，减少产量。</textarea></div></div><div data-v-2497e5b3=\"\"><h2 data-v-2497e5b3=\"\">三、田管意见</h2><div data-v-2497e5b3=\"\"><textarea data-v-2497e5b3=\"\" cols=\"30\" rows=\"10\" placeholder=\"请输入对当前问题的对应及下一阶段田管措施\" class=\"textarea\" disabled=\"true\" style=\"\n        width: 98%;\n        border: none;\n        outline: none;\n        border-bottom: 1px solid #000;\n        background:none;\n        height: 30px;\n        line-height: 30px;\n        font-size: 20px;\n        padding-left: 30px;\n        margin: 0 0 10px 0 ;\n        \">现阶段，我区再生稻后茬正处于抽穗扬花期，注意适时上水润墒，一季稻正处于成熟期，注意水的管理，应该潜水或无水管理。大水容易引发贪青倒伏，籽粒上得不饱满，空瘪率，秕米多。收割前不宜过早断水，一般在收获前一周开沟断水。</textarea></div></div>', '2021-12-28 00:00:00', '0221202101', '1');
INSERT INTO `research_report` VALUES ('256', '2021年度一季稻抽穗－灌浆期苗情', 'crop_01', 'http://139.224.41.123', '<h1 data-v-e38b2f7a=\"\" style=\"width: 80%; margin: 0px auto; text-align: center;\"><input data-v-e38b2f7a=\"\" type=\"text\" class=\"title\" style=\"width: 70%; background: none; font-size: 25px; text-align: center; border: none;\" value=\"2021年度一季稻抽穗－灌浆期苗情\" disabled=\"true\"></h1><div data-v-e38b2f7a=\"\"><h2 data-v-e38b2f7a=\"\">一、不同阶段的预产结果</h2><p data-v-e38b2f7a=\"\">\n          &nbsp;&nbsp;当前处在灌浆至成熟阶段的一季稻面积约<u data-v-e38b2f7a=\"\">13.98</u>万亩，\n          占总面积<u data-v-e38b2f7a=\"\">1.00</u>%左右；\n          9月上旬以后抽穗扬花的约<u data-v-e38b2f7a=\"\">0.00</u>万亩，\n          占总面积<u data-v-e38b2f7a=\"\">0.00</u>%，\n          较去年<u data-v-e38b2f7a=\"\">增加0.00</u>个百分点。\n        </p><p data-v-e38b2f7a=\"\">\n          &nbsp;&nbsp;据调查，7月31日前抽穗扬花的早熟中籼稻，全县（市、区）约<u data-v-e38b2f7a=\"\">1.68</u>万亩，\n          平均亩有效穗 <u data-v-e38b2f7a=\"\">18.48</u>万，每穗总粒数<u data-v-e38b2f7a=\"\">195.00</u> 粒，\n          结实率 <u data-v-e38b2f7a=\"\">80.80</u>%，千粒重按<u data-v-e38b2f7a=\"\">26.00</u> 克计，\n          九折预估亩产<u data-v-e38b2f7a=\"\">5.85</u>公斤，\n          较去年同期（ <u data-v-e38b2f7a=\"\">0.00</u>公斤）<u data-v-e38b2f7a=\"\">增加0.00</u>  %。\n          <input data-v-e38b2f7a=\"\" type=\"text\" placeholder=\"输入分布地区、前茬类型及当前天气对抽穗扬花的评价\" class=\"input\" value=\"根据气象部门预报，9月中下旬无明显高温等极端天气，无不利于一季稻抽穗扬花、灌浆、成熟收获的因素。\" disabled=\"true\" style=\"\n        width: 98%;\n        border: none;\n        outline: none;\n        border-bottom: 1px solid #000;\n        background:none;\n        height: 30px;\n        line-height: 30px;\n        font-size: 20px;\n        padding-left: 30px;\n        margin: 0 0 10px 0 ;\n        \"></p><p data-v-e38b2f7a=\"\">\n          &nbsp;&nbsp;8月上旬抽穗扬花的中籼稻，全县（市、区）约<u data-v-e38b2f7a=\"\">6.50</u>万亩，\n          平均亩有效穗 <u data-v-e38b2f7a=\"\">22.70</u>万，每穗总粒数<u data-v-e38b2f7a=\"\">198.20</u> 粒，\n          结实率 <u data-v-e38b2f7a=\"\">86.20</u>%，千粒重按<u data-v-e38b2f7a=\"\">26.00</u> 克计，\n          九折预估亩产<u data-v-e38b2f7a=\"\">6.12</u>公斤，\n          较去年同期（ <u data-v-e38b2f7a=\"\">0.00</u>公斤）<u data-v-e38b2f7a=\"\">增加0.00</u>  %。\n          <input data-v-e38b2f7a=\"\" type=\"text\" placeholder=\"请输入分布地区、前茬类型及当前天气对抽穗扬花的评价\" class=\"input\" value=\"根据气象部门预报，9月中下旬无明显高温等极端天气，无不利于一季稻抽穗扬花、灌浆、成熟收获的因素。\" disabled=\"true\" style=\"\n        width: 98%;\n        border: none;\n        outline: none;\n        border-bottom: 1px solid #000;\n        background:none;\n        height: 30px;\n        line-height: 30px;\n        font-size: 20px;\n        padding-left: 30px;\n        margin: 0 0 10px 0 ;\n        \"></p><p data-v-e38b2f7a=\"\">\n          &nbsp;&nbsp;8月中旬抽穗扬花的中籼稻，全县（市、区）约<u data-v-e38b2f7a=\"\">5.80</u>万亩，\n          平均亩有效穗 <u data-v-e38b2f7a=\"\">37.00</u>万，每穗总粒数<u data-v-e38b2f7a=\"\">403.10</u> 粒，\n          结实率 <u data-v-e38b2f7a=\"\">176.30</u>%，千粒重按<u data-v-e38b2f7a=\"\">52.00</u> 克计，\n          九折预估亩产<u data-v-e38b2f7a=\"\">12.25</u>公斤，\n          较去年同期（ <u data-v-e38b2f7a=\"\">0.00</u>公斤）<u data-v-e38b2f7a=\"\">增加0.00</u>  %。\n          <input data-v-e38b2f7a=\"\" type=\"text\" placeholder=\"请输入分布地区、前茬类型及当前天气对抽穗扬花的评价\" class=\"input\" value=\"根据气象部门预报，9月中下旬无明显高温等极端天气，无不利于一季稻抽穗扬花、灌浆、成熟收获的因素。\" disabled=\"true\" style=\"\n        width: 98%;\n        border: none;\n        outline: none;\n        border-bottom: 1px solid #000;\n        background:none;\n        height: 30px;\n        line-height: 30px;\n        font-size: 20px;\n        padding-left: 30px;\n        margin: 0 0 10px 0 ;\n        \"></p><p data-v-e38b2f7a=\"\">\n          &nbsp;&nbsp;8月下旬抽穗扬花的中籼稻，全县（市、区）约<u data-v-e38b2f7a=\"\">0.00</u>万亩，\n          平均亩有效穗 <u data-v-e38b2f7a=\"\">0.00</u>万，每穗总粒数<u data-v-e38b2f7a=\"\">0.00</u> 粒，\n          结实率 <u data-v-e38b2f7a=\"\">0.00</u>%，千粒重按<u data-v-e38b2f7a=\"\">0.00</u> 克计，\n          九折预估亩产<u data-v-e38b2f7a=\"\">0.00</u>公斤，\n          较去年同期（ <u data-v-e38b2f7a=\"\">0.00</u>公斤）<u data-v-e38b2f7a=\"\">增加0.00</u>  %。\n          <input data-v-e38b2f7a=\"\" type=\"text\" placeholder=\"请输入分布地区、前茬类型及当前天气对抽穗扬花的评价\" class=\"input\" value=\"根据气象部门预报，9月中下旬无明显高温等极端天气，无不利于一季稻抽穗扬花、灌浆、成熟收获的因素。\" disabled=\"true\" style=\"\n        width: 98%;\n        border: none;\n        outline: none;\n        border-bottom: 1px solid #000;\n        background:none;\n        height: 30px;\n        line-height: 30px;\n        font-size: 20px;\n        padding-left: 30px;\n        margin: 0 0 10px 0 ;\n        \"></p><p data-v-e38b2f7a=\"\">\n          9月上旬以后抽穗扬花的一季稻，全县（市、区）约<u data-v-e38b2f7a=\"\"></u> 万亩，具体结实情况有待进一步监测。   \n          <input data-v-e38b2f7a=\"\" type=\"text\" placeholder=\"请输入分布地区、前茬类型及当前天气对抽穗扬花的评价\" class=\"input\" value=\"根据气象部门预报，9月中下旬无明显高温等极端天气，无不利于一季稻抽穗扬花、灌浆、成熟收获的因素。\" disabled=\"true\" style=\"\n        width: 98%;\n        border: none;\n        outline: none;\n        border-bottom: 1px solid #000;\n        background:none;\n        height: 30px;\n        line-height: 30px;\n        font-size: 20px;\n        padding-left: 30px;\n        margin: 0 0 10px 0 ;\n        \"></p></div><div data-v-e38b2f7a=\"\"><h2 data-v-e38b2f7a=\"\">二、主要问题</h2><div data-v-e38b2f7a=\"\"><textarea data-v-e38b2f7a=\"\" cols=\"30\" rows=\"10\" placeholder=\"请输入当前生产中遇到的问题\" class=\"textarea\" disabled=\"true\" style=\"\n        width: 98%;\n        border: none;\n        outline: none;\n        border-bottom: 1px solid #000;\n        background:none;\n        height: 30px;\n        line-height: 30px;\n        font-size: 20px;\n        padding-left: 30px;\n        margin: 0 0 10px 0 ;\n        \">由于9月中下旬干燥无雨，再生稻后季正处于灌浆期，缺水易受损，应及时上水。一季稻陆续进入收获期，晴好天气有利于收获。迟熟单季稻10月1日以后收割的要及时灌跑马水，以防止水稻早衰，造成后期倒伏。\n墒情较差的田块，不利于油菜播种出苗，建议造墒播种，已实现一播全苗，</textarea></div></div><div data-v-e38b2f7a=\"\"><h2 data-v-e38b2f7a=\"\">三、田管意见</h2><div data-v-e38b2f7a=\"\"><textarea data-v-e38b2f7a=\"\" cols=\"30\" rows=\"10\" placeholder=\"请输入对当前问题的对应及下一阶段田管措施\" class=\"textarea\" disabled=\"true\" style=\"\n        width: 98%;\n        border: none;\n        outline: none;\n        border-bottom: 1px solid #000;\n        background:none;\n        height: 30px;\n        line-height: 30px;\n        font-size: 20px;\n        padding-left: 30px;\n        margin: 0 0 10px 0 ;\n        \">今年中籼稻部分混栽区二化螟发生较为严重，其他病虫危害比往年轻。在抽穗扬花期，虽受天气影响，但植保部门及时发放病虫情报，指导农户科学用药，农户防控病虫害意识普遍增强，抓住雨间隙，利用无人机飞防开展1-2次大面积防治和统防统治，穗期病虫害得到了有效预防。</textarea></div></div>', '2021-12-28 00:00:00', '0221202101', '1');
INSERT INTO `research_report` VALUES ('257', '2021年度一季稻预测产情况', 'crop_01', 'http://139.224.41.123', '<h1 data-v-408fd9d0=\"\" style=\"width: 80%; margin: 0px auto; text-align: center;\"><input data-v-408fd9d0=\"\" type=\"text\" class=\"title\" style=\"width: 70%; background: none; font-size: 25px; text-align: center; border: none;\" value=\"2021年度一季稻预测产情况\" disabled=\"true\"></h1><div data-v-408fd9d0=\"\"><h2 data-v-408fd9d0=\"\">一、收割进度及产量</h2><h3 data-v-408fd9d0=\"\">1．一季稻收割进度</h3><p data-v-408fd9d0=\"\" style=\"\n          font-size: 20px;\n          line-height: 30px;\n          margin: 10px 0 10px 0;\n        \">\n          &nbsp;&nbsp;截至9月24日，全省已收割 <u data-v-408fd9d0=\"\">0.23</u> %，较去年同期<u data-v-408fd9d0=\"\">增加0.00</u>个百分点，\n          <input data-v-408fd9d0=\"\" placeholder=\"手动输入当前天气对收获进度的评价\" type=\"text\" style=\"width: 400px; background: none; border-top: none; border-right: none; border-bottom: 1px solid rgb(0, 0, 0); border-left: none; border-image: initial; font-size: 16px; outline: none;\" value=\"天气晴好，有利于收割\" disabled=\"true\">。\n          主体收割期将在<input data-v-408fd9d0=\"\" type=\"text\" style=\"width: 200px; background: none; border-top: none; border-right: none; border-bottom: 1px solid rgb(0, 0, 0); border-left: none; border-image: initial; font-size: 16px; outline: none;\" value=\"9月25日—10月10日\" disabled=\"true\">,\n          预计收获完成期在<input data-v-408fd9d0=\"\" type=\"text\" style=\"width: 200px; background: none; border-top: none; border-right: none; border-bottom: 1px solid rgb(0, 0, 0); border-left: none; border-image: initial; font-size: 16px; outline: none;\" value=\"10月15日\" disabled=\"true\">。\n        </p><h3 data-v-408fd9d0=\"\">2．平均单产水平</h3><p data-v-408fd9d0=\"\" style=\"\n          font-size: 20px;\n          line-height: 30px;\n          margin: 10px 0 10px 0;\n        \">\n          &nbsp;&nbsp;根据监测点测产，平均亩有效穗 <u data-v-408fd9d0=\"\">0.00</u>万，\n          穗总粒数<u data-v-408fd9d0=\"\">0.00</u>粒，结实率<u data-v-408fd9d0=\"\">0.00</u> %，千粒重<u data-v-408fd9d0=\"\">0.00</u> 克。\n          与去年同期相比较，产量结构呈现“<input data-v-408fd9d0=\"\" type=\"text\" style=\"width: 50px; background: none; border-top: none; border-right: none; border-bottom: 1px solid rgb(0, 0, 0); border-left: none; border-image: initial; font-size: 16px; outline: none;\" value=\"\" disabled=\"true\"> 增  \n          <input data-v-408fd9d0=\"\" type=\"text\" style=\"width: 50px; background: none; border-top: none; border-right: none; border-bottom: 1px solid rgb(0, 0, 0); border-left: none; border-image: initial; font-size: 16px; outline: none;\" value=\"\" disabled=\"true\">减”态势，\n          即有效穗数<u data-v-408fd9d0=\"\">增加0.00</u>万、每穗粒数<u data-v-408fd9d0=\"\">增加0.00</u>  粒、亩结实率<u data-v-408fd9d0=\"\">增加0.00</u> 个百分点、\n          千粒重<u data-v-408fd9d0=\"\">增加0.00</u>克。\n          按面积加权，平均亩产<u data-v-408fd9d0=\"\">增加0.00</u>公斤/亩，与去年同期 <u data-v-408fd9d0=\"\">0.00</u>公斤/亩基本持平。\n        </p></div><div data-v-408fd9d0=\"\"><h2 data-v-408fd9d0=\"\">二、生长形势分析</h2><div data-v-408fd9d0=\"\"><textarea data-v-408fd9d0=\"\" cols=\"30\" rows=\"10\" placeholder=\"输入本生产季天气状况对水稻生产的影响，及当前生产中遇到的问题\" class=\"textarea\" disabled=\"true\" style=\"\n        width: 98%;\n        border: none;\n        outline: none;\n        border-bottom: 1px solid #000;\n        background:none;\n        height: 30px;\n        line-height: 30px;\n        font-size: 20px;\n        padding-left: 30px;\n        margin: 0 0 10px 0 ;\n        \">由于9月中下旬干燥无雨，再生稻后季正处于灌浆期，缺水易受损，应及时上水。一季稻陆续进入收获期，晴好天气有利于收获。迟熟单季稻10月1日以后收割的要及时灌跑马水，以防止水稻早衰，造成后期倒伏。\n墒情较差的田块，不利于油菜播种出苗，建议造墒播种，已实现一播全苗。</textarea></div></div><div data-v-408fd9d0=\"\"><h2 data-v-408fd9d0=\"\">三、田管意见</h2><div data-v-408fd9d0=\"\"><textarea data-v-408fd9d0=\"\" cols=\"30\" rows=\"10\" placeholder=\"请输入对当前问题的对应及下一阶段田管措施\" class=\"textarea\" disabled=\"true\" style=\"\n        width: 98%;\n        border: none;\n        outline: none;\n        border-bottom: 1px solid #000;\n        background:none;\n        height: 30px;\n        line-height: 30px;\n        font-size: 20px;\n        padding-left: 30px;\n        margin: 0 0 10px 0 ;\n        \">今年中籼稻部分混栽区二化螟发生较为严重，其他病虫危害比往年轻。在抽穗扬花期，虽受天气影响，但植保部门及时发放病虫情报，指导农户科学用药，农户防控病虫害意识普遍增强，抓住雨间隙，利用无人机飞防开展1-2次大面积防治和统防统治，穗期病虫害得到了有效预防。</textarea></div></div>', '2021-12-28 00:00:00', '0221202101', '1');
