INSERT INTO `research_report` VALUES ('268', '2021年度一季稻抽穗期苗情（一）', 'crop_01', 'http://139.224.41.123', '<h1 data-v-22d6ef6f=\"\" style=\"width: 80%; margin: 0px auto; text-align: center;\"><input data-v-22d6ef6f=\"\" type=\"text\" class=\"title\" style=\"width: 70%; font-size: 25px; text-align: center; border: none; font-weight: bold;\" value=\"年度一季稻抽穗期苗情（一）\" disabled=\"true\"></h1><h1 data-v-22d6ef6f=\"\" style=\"width: 50%; margin: 0px auto; text-align: center; font-size: 23px;\">一季稻生育进程及高温热害的影响</h1><div data-v-22d6ef6f=\"\"><h2 data-v-22d6ef6f=\"\">一、当前苗情</h2><h3 data-v-22d6ef6f=\"\">1．生育进程</h3><p data-v-22d6ef6f=\"\" style=\"font-size: 20px; line-height: 30px;\">\r\n          &nbsp;&nbsp;全县（市、区）一季稻面积<input data-v-22d6ef6f=\"\" type=\"text\" style=\"width: 40px; background: none; border-top: none; border-right: none; border-bottom: 1px solid rgb(0, 0, 0); border-left: none; border-image: initial; font-size: 20px; outline: none;\" value=\"\" disabled=\"true\">万亩，\r\n          较去年<input data-v-22d6ef6f=\"\" type=\"text\" style=\"width: 100px; border-top: none; border-right: none; border-bottom: 1px solid rgb(0, 0, 0); border-left: none; border-image: initial; background: none; font-size: 20px; outline: none;\" value=\"\" disabled=\"true\">万亩。\r\n          8月20日前全省处在抽穗扬花至灌浆期的一季稻 <u data-v-22d6ef6f=\"\">22.7</u> 万亩左右，占总面积 <u data-v-22d6ef6f=\"\">75.2</u> %，比去年 <u data-v-22d6ef6f=\"\">增加0.0</u> 个百分点；\r\n          预计8月下旬至9月上中旬抽穗扬花的<u data-v-22d6ef6f=\"\">0.0</u> 万亩左右，占总面积 <u data-v-22d6ef6f=\"\">0.0</u> %，比去年 <u data-v-22d6ef6f=\"\">增加0.00</u> 个百分点；\r\n        </p><h3 data-v-22d6ef6f=\"\">2．不同时段抽穗的产量水平</h3><p data-v-22d6ef6f=\"\" style=\"font-size: 20px; line-height: 30px;\">\r\n          &nbsp;&nbsp;其中，7月31日前抽穗扬花的，约 <u data-v-22d6ef6f=\"\">10.4</u> 万亩左右，占 <u data-v-22d6ef6f=\"\">增加0.0</u>%，\r\n          <input data-v-22d6ef6f=\"\" type=\"text\" placeholder=\"请输入分布地区、前茬类型及当前天气对抽穗扬花的评价\" style=\"width: 98%;\" value=\"\" disabled=\"true\">\r\n\r\n          &nbsp;&nbsp;据调查，平均亩有效穗<u data-v-22d6ef6f=\"\">22.0</u> 万，每穗总粒数 <u data-v-22d6ef6f=\"\">202.0</u>粒，结实率 <u data-v-22d6ef6f=\"\">79.6</u>%，\r\n          千粒重按 <u data-v-22d6ef6f=\"\">1270.4</u> 克计，理论亩产 <u data-v-22d6ef6f=\"\">381.8</u>公斤，比去年同期（<u data-v-22d6ef6f=\"\">0.0</u>公斤）<u data-v-22d6ef6f=\"\"></u> %\r\n        </p><p data-v-22d6ef6f=\"\" style=\"font-size: 20px; line-height: 30px;\">\r\n          &nbsp;&nbsp;其中，8月上旬抽穗扬花的中籼稻，全县（市、区）约 <u data-v-22d6ef6f=\"\">11.4</u> 万亩左右，占 <u data-v-22d6ef6f=\"\">37.7</u>%，\r\n          <input data-v-22d6ef6f=\"\" type=\"text\" placeholder=\"请输入分布地区、前茬类型及当前天气对抽穗扬花的评价\" style=\"width: 98%;\" value=\"\" disabled=\"true\">\r\n\r\n          &nbsp;&nbsp;据初步调查，\r\n          \r\n          结实率 <u data-v-22d6ef6f=\"\">58.1</u>%，\r\n          </p><p data-v-22d6ef6f=\"\" style=\"font-size: 20px; line-height: 30px;\">\r\n          &nbsp;&nbsp;8月中下旬抽穗扬花的中籼稻，全县（市、区）约 <u data-v-22d6ef6f=\"\">0.9</u> 万亩，占 <u data-v-22d6ef6f=\"\">3.0 </u>%。\r\n          <input data-v-22d6ef6f=\"\" type=\"text\" placeholder=\"手动输入分布地区、前茬类型及当前天气对抽穗扬花的评价\" value=\"\" disabled=\"true\"></p><p data-v-22d6ef6f=\"\" style=\"font-size: 20px; line-height: 30px;\">\r\n          &nbsp;&nbsp;9月上中旬抽穗扬花的中籼稻，全县（市、区） <u data-v-22d6ef6f=\"\">0.0</u> 万亩，约占 <u data-v-22d6ef6f=\"\">0.0 </u>%。\r\n          <input data-v-22d6ef6f=\"\" type=\"text\" placeholder=\"手动输入分布地区、前茬类型及当前天气对抽穗扬花的评价\" value=\"\" disabled=\"true\"></p><h3 data-v-22d6ef6f=\"\">3．叶龄、群体茎蘖数</h3><p data-v-22d6ef6f=\"\"><span data-v-22d6ef6f=\"\" style=\"font-weight: bold;\">籼稻:</span> 移栽的平均亩茎蘖数<u data-v-22d6ef6f=\"\">0</u>万，与去年同期<u data-v-22d6ef6f=\"\">多0</u>万；\r\n            叶龄<u data-v-22d6ef6f=\"\">0</u>叶，较去年同期 <u data-v-22d6ef6f=\"\">多0</u>  叶。\r\n            其中，人工移栽的平均亩茎蘖数为 <u data-v-22d6ef6f=\"\">0</u>万，叶龄<u data-v-22d6ef6f=\"\">0</u> 叶；\r\n            机插的平均亩茎蘖数 <u data-v-22d6ef6f=\"\">0</u> 万，叶龄 <u data-v-22d6ef6f=\"\">0</u> 叶；\r\n            抛栽的平均亩茎蘖数 <u data-v-22d6ef6f=\"\">0</u> 万，叶龄 <u data-v-22d6ef6f=\"\">0</u> 叶。\r\n  