INSERT INTO `research_report` VALUES ('276', '2022年度一季稻栽播期苗情', 'crop_01', 'http://139.224.41.123', '<h1 data-v-b5b77a66=\"\" style=\"width: 50%; margin: 0px auto; text-align: center;\"><input data-v-b5b77a66=\"\" type=\"text\" class=\"title\" style=\"width: 70%; font-size: 25px; background: none; text-align: center; border: none;\" value=\"年度一季稻栽播期苗情\" disabled=\"true\"></h1><div data-v-b5b77a66=\"\"><h2 data-v-b5b77a66=\"\">一、栽插进度及苗情</h2><h3 data-v-b5b77a66=\"\">1．一季稻种植茬口类型与面积比较:</h3><p data-v-b5b77a66=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n          30个监测县统计，一季稻种植面积<u data-v-b5b77a66=\"\">200.04000000000002</u>万亩，\r\n          占全省一季稻计划播种面积的<u data-v-b5b77a66=\"\">15%</u>，比去年 <u data-v-b5b77a66=\"\">增加179.0</u>万亩 。\r\n          茬口方面，水稻茬口 <u data-v-b5b77a66=\"\">20.0</u>万亩，占 <u data-v-b5b77a66=\"\">10.0</u>%，比去年<u data-v-b5b77a66=\"\">增加20.0</u>万亩；\r\n          小麦茬口 <u data-v-b5b77a66=\"\">5.0</u>万亩，占 <u data-v-b5b77a66=\"\">2.5</u>%，比去年<u data-v-b5b77a66=\"\">增加1.3</u>万亩；\r\n          油菜茬口 <u data-v-b5b77a66=\"\">7.9</u>万亩，占 <u data-v-b5b77a66=\"\">3.9</u>%，比去年<u data-v-b5b77a66=\"\">增加0.2</u>万亩；\r\n          空闲田茬口 <u data-v-b5b77a66=\"\">2.4</u>万亩，占 <u data-v-b5b77a66=\"\">1.2</u>%，比去年<u data-v-b5b77a66=\"\">增加0.6</u>万亩；\r\n          蔬菜经作等茬口 <u data-v-b5b77a66=\"\">2.0</u>万亩，占 <u data-v-b5b77a66=\"\">1.0</u>%，比去年<u data-v-b5b77a66=\"\">增加1.2</u>万亩；\r\n          绿肥茬口 <u data-v-b5b77a66=\"\">4.0</u>万亩，占 <u data-v-b5b77a66=\"\">2.0</u>%，比去年<u data-v-b5b77a66=\"\">增加3.0</u>万亩。    \r\n        </p><div data-v-b5b77a66=\"\" _echarts_instance_=\"ec_1649398535132\" style=\"width: 1000px; height: 300px; -webkit-tap-highlight-color: transparent; user-select: none; position: relative; display: none;\"><div style=\"position: relative; overflow: hidden; width: 1000px; height: 300px; padding: 0px; margin: 0px; border-width: 0px; cursor: default;\"><canvas data-zr-dom-id=\"zr_0\" width=\"1000\" height=\"300\" style=\"position: absolute; left: 0px; top: 0px; width: 1000px; height: 300px; user-select: none; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); padding: 0px; margin: 0px; border-width: 0px;\"></canvas></div><div></div></div><div data-v-b5b77a66=\"\"><img width=\"1000px\" src=\"data:image/png;base64,\"></div><div data-v-b5b77a66=\"\"><input data-v-b5b77a66=\"\" type=\"text\" placeholder=\"请输入对茬口面积变化的评价\" class=\"input\" value=\"\" disabled=\"true\" style=\"\r\n        width: 98%;\r\n        border: none;\r\n        outline: none;\r\n        border-bottom: 1px solid #000;\r\n        background:none;\r\n        height: 30px;\r\n        line-height: 30px;\r\n        font-size: 20px;\r\n        padding-left: 30px;\r\n        margin: 0 0 10px 0 ;\r\n        \"></div><h3 data-v-b5b77a66=\"\">2. 种植类型与面积比较:</h3><p data-v-b5b77a66=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n          据30个监测县统计，一季稻人工移栽约<u data-v-b5b77a66=\"\">51.1</u>万亩，占 <u data-v-b5b77a66=\"\">25.5</u>%,比去年<u data-v-b5b77a66=\"\">增加315.4</u>个百分点；\r\n          机械插秧约<u data-v-b5b77a66=\"\">49.7</u>万亩，占 <u data-v-b5b77a66=\"\">24.8</u>%,比去年<u data-v-b5b77a66=\"\">增加351.7</u>个百分点；\r\n          盘育抛栽约<u data-v-b5b77a66=\"\">27.7</u>万亩，占 <u data-v-b5b77a66=\"\">13.9</u>%,比去年<u data-v-b5b77a66=\"\">增加100</u>个百分点；\r\n          无盘旱育抛栽约<u data-v-b5b77a66=\"\">15.3</u>万亩，占 <u data-v-b5b77a66=\"\">7.7</u>%,比去年<u data-v-b5b77a66=\"\">增加378.8</u>个百分点；\r\n          撒直播(旱)约<u data-v-b5b77a66=\"\">25.9</u>万亩，占 <u data-v-b5b77a66=\"\">13.0</u>%,比去年<u data-v-b5b77a66=\"\">增加100</u>个百分点；\r\n          撒直播(水)约<u data-v-b5b77a66=\"\">8.6</u>万亩，占 <u data-v-b5b77a66=\"\">4.3</u>%,比去年<u data-v-b5b77a66=\"\">增加4.9</u>个百分点；\r\n          机条播(旱)约<u data-v-b5b77a66=\"\">15.7</u>万亩，占 <u data-v-b5b77a66=\"\">7.8</u>%,比去年<u data-v-b5b77a66=\"\">增加100</u>个百分点；\r\n          机条播(水)约<u data-v-b5b77a66=\"\">6.0</u>万亩，占 <u data-v-b5b77a66=\"\">3.0</u>%,比去年<u data-v-b5b77a66=\"\">增加1402.5</u>个百分点； \r\n        </p><div data-v-b5b77a66=\"\" _echarts_instance_=\"ec_1649398535133\" style=\"width: 1000px; height: 300px; -webkit-tap-highlight-color: transparent; user-select: none; position: relative; display: none;\"><div style=\"position: relative; overflow: hidden; width: 1000px; height: 300px; padding: 0px; margin: 0px; border-width: 0px;\"><canvas data-zr-dom-id=\"zr_0\" width=\"1000\" height=\"300\" style=\"position: absolute; left: 0px; top: 0px; width: 1000px; height: 300px; user-select: none; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); padding: 0px; margin: 0px; border-width: 0px;\"></canvas></div><div></div></div><div data-v-b5b77a66=\"\"><img width=\"1000px\" src=\"data:image/png;base64,\"></div><div data-v-b5b77a66=\"\"><input data-v-b5b77a66=\"\" type=\"text\" placeholder=\"请输入对种植类型面积变化的评价\" class=\"input\" value=\"\" disabled=\"true\" style=\"\r\n        width: 98%;\r\n        border: none;\r\n        outline: none;\r\n        border-bottom: 1px solid #000;\r\n        background:none;\r\n        height: 30px;\r\n        line-height: 30px;\r\n        font-size: 20px;\r\n        padding-left: 30px;\r\n        margin: 0 0 10px 0 ;\r\n        \"></div><h3 data-v-b5b77a66=\"\">3．主导品种介绍:</h3><p data-v-b5b77a66=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n          种植面积较大的有<u data-v-b5b77a66=\"\">丰两优4号</u><u data-v-b5b77a66=\"\"></u><u data-v-b5b77a66=\"\">晶两优华占</u><u data-v-b5b77a66=\"\">丰两优香一号</u><u data-v-b5b77a66=\"\">徽两优985</u><u data-v-b5b77a66=\"\">晶两优1212</u>，共计<u data-v-b5b77a66=\"\">504.3</u>万亩\r\n          ,占<u data-v-b5b77a66=\"\">201.7</u>%，比去年 <u data-v-b5b77a66=\"\">增加504.3</u>万亩。\r\n        </p><div data-v-b5b77a66=\"\"><input data-v-b5b77a66=\"\" type=\"text\" placeholder=\"请输入对主要品种面积变化的评价\" class=\"input\" value=\"\" disabled=\"true\" style=\"\r\n        width: 98%;\r\n        border: none;\r\n        outline: none;\r\n        border-bottom: 1px solid #000;\r\n        background:none;\r\n        height: 30px;\r\n        line-height: 30px;\r\n        font-size: 20px;\r\n        padding-left: 30px;\r\n        margin: 0 0 10px 0 ;\r\n        \"></div><h3 data-v-b5b77a66=\"\">4．播栽期、栽插进度:</h3><p data-v-b5b77a66=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n          截至 <u data-v-b5b77a66=\"\">3</u>月<u data-v-b5b77a66=\"\">5</u>日，30个监测县一季稻播栽约<u data-v-b5b77a66=\"\">100.01</u>万亩，占总面积的 <u data-v-b5b77a66=\"\">25.0</u> %，\r\n          较去年<u data-v-b5b77a66=\"\">减少18.6</u>个百分点。\r\n        </p><div data-v-b5b77a66=\"\"><input data-v-b5b77a66=\"\" type=\"text\" placeholder=\"请输入对当前栽插进度的评价\" class=\"input\" value=\"\" disabled=\"true\" style=\"\r\n        width: 98%;\r\n        border: none;\r\n        outline: none;\r\n        border-bottom: 1px solid #000;\r\n        background:none;\r\n        height: 30px;\r\n        line-height: 30px;\r\n        font-size: 20px;\r\n        padding-left: 30px;\r\n        margin: 0 0 10px 0 ;\r\n        \"></div><h3 data-v-b5b77a66=\"\">5．苗情长势介绍:</h3><div data-v-b5b77a66=\"\"><input data-v-b5b77a66=\"\" type=\"text\" placeholder=\"请输入当前所处生育期，及天气对苗情长势的影响\" class=\"input\" value=\"\" disabled=\"true\" style=\"\r\n        width: 98%;\r\n        border: none;\r\n        outline: none;\r\n        border-bottom: 1px solid #000;\r\n        background:none;\r\n        height: 30px;\r\n        line-height: 30px;\r\n        font-size: 20px;\r\n        padding-left: 30px;\r\n        margin: 0 0 10px 0 ;\r\n        \"></div></div><div data-v-b5b77a66=\"\"><h2 data-v-b5b77a66=\"\">二、主要问题</h2><div data-v-b5b77a66=\"\"><textarea data-v-b5b77a66=\"\" cols=\"30\" rows=\"10\" placeholder=\"请输入当前生产中遇到的问题\" class=\"textarea\" disabled=\"true\" style=\"\r\n        width: 98%;\r\n        border: none;\r\n        outline: none;\r\n        border-bottom: 1px solid #000;\r\n        background:none;\r\n        height: 30px;\r\n        line-height: 30px;\r\n        font-size: 20px;\r\n        padding-left: 30px;\r\n        margin: 0 0 10px 0 ;\r\n        \"></textarea></div></div><div data-v-b5b77a66=\"\"><h2 data-v-b5b77a66=\"\">三、田管意见</h2><div data-v-b5b77a66=\"\"><textarea data-v-b5b77a66=\"\" cols=\"30\" rows=\"