INSERT INTO `research_report` VALUES ('279', '2022年度双季早稻播栽期苗情', 'crop_01', 'http://139.224.41.123', '<h1 data-v-8cbdc8da=\"\" style=\"width: 80%; margin: 0px auto; text-align: center;\"><input data-v-8cbdc8da=\"\" type=\"text\" class=\"title\" style=\"width: 70%; font-size: 25px; background: none; text-align: center; border: none;\" value=\"2022年度双季早稻播栽期苗情\" disabled=\"true\"></h1><div data-v-8cbdc8da=\"\"><h2 data-v-8cbdc8da=\"\">一、播栽情况</h2><h3 data-v-8cbdc8da=\"\">1．播栽期介绍:</h3><p data-v-8cbdc8da=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n            全县（市、区）早稻育秧（含工厂化育秧）最早播种期在<u data-v-8cbdc8da=\"\">2022-03-20</u>左右，多数播种期集中在\r\n            <input data-v-8cbdc8da=\"\" placeholder=\"手动输入播栽期变化的评价\" type=\"text\" class=\"input\" style=\"\r\n        width: 98%;\r\n        border: none;\r\n        outline: none;\r\n        border-bottom: 1px solid #000;\r\n        background:none;\r\n        height: 30px;\r\n        line-height: 30px;\r\n        font-size: 20px;\r\n        padding-left: 30px;\r\n        margin: 0 0 10px 0 ;\r\n        \" value=\"\" disabled=\"true\">。\r\n            <input data-v-8cbdc8da=\"\" placeholder=\"手动输入介绍移栽天气及进度\" type=\"text\" class=\"input\" style=\"\r\n        width: 98%;\r\n        border: none;\r\n        outline: none;\r\n        border-bottom: 1px solid #000;\r\n        background:none;\r\n        height: 30px;\r\n        line-height: 30px;\r\n        font-size: 20px;\r\n        padding-left: 30px;\r\n        margin: 0 0 10px 0 ;\r\n        \" value=\"\" disabled=\"true\">。\r\n            预计<u data-v-8cbdc8da=\"\">2022-04-25</u>完成移栽。直播早稻播种期时间集中在\r\n            <input data-v-8cbdc8da=\"\" placeholder=\"手动输入介绍\" type=\"text\" class=\"input\" style=\"\r\n        width: 98%;\r\n        border: none;\r\n        outline: none;\r\n        border-bottom: 1px solid #000;\r\n        background:none;\r\n        height: 30px;\r\n        line-height: 30px;\r\n        font-size: 20px;\r\n        padding-left: 30px;\r\n        margin: 0 0 10px 0 ;\r\n 