INSERT INTO `screen_pestcure` VALUES ('1', 'https://gimg2.baidu.com/image_search/src=http%3A%2F%2Fwww.zsbeike.com%2Fimgs%2FK%2FK05013%2Fk05013_tm.txt.568ca2.jpg&refer=http%3A%2F%2Fwww.zsbeike.com&app=2002&size=f9999,10000&q=a80&n=0&g=0n&fmt=jpeg?sec=1639184715&t=6451b9d81fd209736510ab3701aad95a', '恶苗病', '病谷粒播后常不发芽或不能出土,在枯死苗上有淡红或白色霉粉状物，即病原菌的分生孢子', '氰烯菌酯(防效100%)、二硫氰基甲烷、恶霉灵、咪鲜胺、多菌灵、丙环唑、硅唑咪鲜胺');
INSERT INTO `screen_pestcure` VALUES ('2', 'https://gimg2.baidu.com/image_search/src=http%3A%2F%2Fwww.114nz.com%2Fuploadfile%2F2013%2F0426%2F20130426094143931.jpg&refer=http%3A%2F%2Fwww.114nz.com&app=2002&size=f9999,10000&q=a80&n=0&g=0n&fmt=jpeg?sec=1639184745&t=2dee22884a50004f06eb4907f11c6d98', '稻瘟病', '稻瘟病又名稻热病、火烧瘟、叩头瘟等，是由稻瘟病原菌引起的，为害秧苗、叶片、穗、节等，分别称为苗瘟、叶瘟、穗瘟和节瘟', '三环唑、春雷霉素、稻瘟酰胺、稻瘟灵');
INSERT INTO `screen_pestcure` VALUES ('3', 'https://gimg2.baidu.com/image_search/src=http%3A%2F%2Fwww.my478.com%2Fupload%2F202101%2F1610044850420471.jpg&refer=http%3A%2F%2Fwww.my478.com&app=2002&size=f9999,10000&q=a80&n=0&g=0n&fmt=jpeg?sec=1639184785&t=bf9285852dc18ca28223c668ae9c0d6e', '白叶枯病', '白叶枯病主要发生于叶片及叶鞘上。初起在叶缘产生半透明黄色小斑，以后沿叶缘一侧或两侧或沿中脉发展成波纹状的黄绿或灰绿色病斑；病部与健部分界线明显；数日后病斑转为灰白色，并向内卷曲', '叶枯唑、井冈霉素、石灰水、乙蒜素');
INSERT INTO `screen_pestcure` VALUES ('4', 'https://gimg2.baidu.com/image_search/src=http%3A%2F%2Fpic.baike.soso.com%2Fugc%2Fbaikepic2%2F14619%2F20151005103726-745462811.jpg%2F0&refer=http%3A%2F%2Fpic.baike.soso.com&app=2002&size=f9999,10000&q=a80&n=0&g=0n&fmt=jpeg?sec=1648001745&t=9d5b5dc28532c86a', '螟虫', '螟虫，是稻的害虫，属鳞翅目。螟虫就是磷翅目有喙亚目 螟蛾科昆虫的统称。中国的常见种类有：螟蛾科的三化螟、褐边螟、二化螟、台湾稻螟和夜蛾科的大螟。三化螟、二化螟和大螟是水稻的历史性大害虫', '三唑磷、杀虫单、甲维盐');
INSERT INTO `screen_pestcure` VALUES ('5', 'https://gimg2.baidu.com/image_search/src=http%3A%2F%2Fwww.my478.com%2Fupload%2F202101%2F1610058152962014.jpg&refer=http%3A%2F%2Fwww.my478.com&app=2002&size=f9999,10000&q=a80&n=0&g=0n&fmt=jpeg?sec=1648001997&t=99658413ededc69f4987e35b4345d872', '纹枯病', '水稻纹枯病是由立枯丝核菌侵染所引起的、发生在水稻上的病害。该病主要发生在叶鞘和叶片上。发病初期，先在近水面的叶鞘上发生椭圆形暗绿色的水渍状病斑，以后逐渐扩大成为云纹状，中部灰白色，潮湿时变为灰绿色。', '水稻纹枯病的防治方法主要分为农业防治和药剂防治，药剂防治主要选用井冈霉素、甲基硫菌灵等进行防治');
INSERT INTO `screen_pestcure` VALUES ('6', 'https://gimg2.baidu.com/image_search/src=http%3A%2F%2Fpic.baike.soso.com%2Fugc%2Fbaikepic2%2F14619%2F20151005103726-745462811.jpg%2F0&refer=http%3A%2F%2Fpic.baike.soso.com&app=2002&size=f9999,10000&q=a80&n=0&g=0n&fmt=jpeg?sec=1648001745&t=9d5b5dc28532c86a', '螟虫', '螟虫，是稻的害虫，属鳞翅目。螟虫就是磷翅目有喙亚目 螟蛾科昆虫的统称。中国的常见种类有：螟蛾科的三化螟、褐边螟、二化螟、台湾稻螟和夜蛾科的大螟。三化螟、二化螟和大螟是水稻的历史性大害虫', '三唑磷、杀虫单、甲维盐');
